import React from 'react';
import * as S from './Loading.styled.js'

export default function Loading() {
  return (
    <S.Loading> 
      <S.OuterWrapper > 
        <S.Wrapper> 
          <S.Inner></S.Inner><S.Inner></S.Inner>
        </S.Wrapper>
        <S.Wrapper> 
          <S.Inner></S.Inner><S.Inner></S.Inner>
        </S.Wrapper>
      </S.OuterWrapper>
    </S.Loading>
  )
}
